    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}User index{% endblock %}

{% block body %}
    <h1>User index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>id<th>
                <th>first_name</th>
                <th>last_name</th>
                <th>birthdate</th>
                <th>email</th>
                <th>password</th>
                <th>pictures</th>
                <th>about</th>
                <th>created_at</th>
                <th>updated_at</th>
            </tr>
        </thead>
    </table>
        <tbody>
        {% for user in users %}
            <tr>
                <tr>{{ user.id }}</tr>
                <td>{{ user.first_name }}</td>
                <td>{{ user.last_name }}</td>
                <td>{{ user.birthdate ? user.birthdate|date('Y-m-d') : '' }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.password }}</td>
                <td>{{ user.pictures }}</td>
                <td>{{ user.about }}</td>
                <td>{{ user.created_at ? user.created_at|date('Y-m-d H-i-s') : '' }}</td>
                <td>{{ user.updated_at ? user.updated_at|date('Y-m-d H-i-s') : '' }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'id': user.id}) }}\"></a>
                    <a href=\"{{ path('user_edit', {'id': user.id}) }}\"></a>
                </td>
            </tr>
        {% else %}
            <tr>
            <td colspan=\"5\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
    
    <a href=\"{{ path('user_new') }}\">Create new</a>

{% endblock %}
", "user/index.html.twig", "/var/www/html/Atlantis/exercice/Projet-Solo-THE-GOOD-ONE-master/templates/user/index.html.twig");
